      out.write("\t\t\t\t\t\talert(\"비밀번호를 3글자 이상 입력하십시오.\");\r\n");
      out.write("\t\t\t\t\t\tf.mb_password.focus();\r\n");
      out.write("\t\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t\tif (f.mb_password.value != f.mb_password_re.value) {\r\n");
      out.write("\t\t\t\t\talert(\"비밀번호가 같지 않습니다.\");\r\n");
      out.write("\t\t\t\t\tf.mb_password_re.focus();\r\n");
      out.write("\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\r\n");
      out.write("\t\t\t\tif (f.mb_password.value.length > 0) {\r\n");
      out.write("\t\t\t\t\tif (f.mb_password_re.value.length < 3) {\r\n");
      out.write("\t\t\t\t\t\talert(\"비밀번호를 3글자 이상 입력하십시오.\");\r\n");
      out.write("\t\t\t\t\t\tf.mb_password_re.focus();\r\n");
      out.write("\t\t\t\t\t\treturn false;\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\r\n");
